import React from "react";
import {Buttons, TextArea, TextBox} from "../../../shared/components";
import "../../.././assets/index.css"

const Comment = ({data, onSubmitHandler, onChangeHandler}) => {
    return (
        <div className="comment">
            <div>
                <form onSubmit={onSubmitHandler}>
                    <div>
                        <div>
                        <TextArea placeholder="Type Your Comment" name="comment" value={data.comment} onChange={onChangeHandler}/>
                        </div>
                    <Buttons type="submit" value="Add"/>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Comment;
